import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import { AppProvider } from './AppContext';
import Formulario from './Formulario';


import './Estilos/App.css';

const App = () => {
  return (
    <AppProvider>
      <BrowserRouter>
        <Routes>
          <Route path='/' Component={Formulario} />
        </Routes>
      </BrowserRouter>
    </AppProvider>
  );
};

export default App;
